INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("クローチェ", 2, 0.0, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 1, 10001, 1, 2002, 1, -470.0, "2023/09/22 14:59:59", 1.47, 126401, "2023/06/30 12:00:00");
