INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ライラエル", 1, 0.0, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 1, 10004, 1, 2002, 2, -470.0, "2023/09/22 14:59:59", 0.0, 126501, "2023/06/30 12:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("リンド", 2, 0.0, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2, 10005, 2, 2002, 1, -470.0, "2023/12/22 14:59:59", 0.0, 127702, "2023/09/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("リンド", 2, 0.0, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 10006, 2, 2002, 2, -470.0, "2023/12/22 14:59:59", 0.0, 127702, "2023/09/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ヴルム", 1, 0.0, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 2, 10007, 1, 2002, 1, -470.0, "2023/12/22 14:59:59", 0.0, 127802, "2023/09/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ヴルム", 1, 0.0, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 2, 10008, 2, 2002, 2, -470.0, "2023/12/22 14:59:59", 6.5, 127802, "2023/09/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("アネモネ", 1, 0.0, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 3, 10009, 2, 2002, 1, -470.0, "2024/03/22 14:59:59", 0.0, 129602, "2023/12/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("アネモネ", 1, 0.0, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 3, 10010, 2, 2002, 2, -470.0, "2024/03/22 14:59:59", 0.0, 129602, "2023/12/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ネフィ=ネラ", 1, 0.0, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 3, 10011, 1, 2002, 1, -470.0, "2024/03/22 14:59:59", 0.0, 129701, "2023/12/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ネフィ=ネラ", 1, 0.0, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 3, 10012, 2, 2002, 2, -470.0, "2024/03/22 14:59:59", 6.2, 129701, "2023/12/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("カノン", 5, 0.0, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 4, 10013, 3, 2002, 1, -470.0, "2024/06/22 14:59:59", 3.1, 130301, "2024/03/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("カノン", 2, 0.0, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 4, 10014, 3, 2002, 2, -470.0, "2024/06/22 14:59:59", 6.15, 130301, "2024/03/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ナーナ", 2, 0.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 4, 10015, 2, 2002, 1, -470.0, "2024/06/22 14:59:59", 0.0, 130401, "2024/03/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ナーナ", 1, 0.0, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 4, 10016, 2, 2002, 2, -470.0, "2024/06/22 14:59:59", 3.35, 130401, "2024/03/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ホウオウ", 1, 0.0, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 5, 10017, 1, 2002, 1, -470.0, "2024/09/22 14:59:59", 0.0, 130502, "2024/06/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ホウオウ", 1, 0.0, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 5, 10018, 2, 2002, 2, -470.0, "2024/09/22 14:59:59", 3.18, 130502, "2024/06/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ホウオウ", 4, 0.0, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 5, 10019, 4, 2002, 3, -470.0, "2024/09/22 14:59:59", 0.0, 130503, "2024/06/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ネア", 2, 0.0, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 5, 10020, 1, 2002, 1, -470.0, "2024/09/22 14:59:59", 4.9, 123301, "2024/06/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ネア", 2, 0.0, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 5, 10021, 1, 2002, 2, -470.0, "2024/09/22 14:59:59", 4.8, 123301, "2024/06/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("カリザ", 1, 0.0, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 6, 10022, 3, 2002, 1, -470.0, "2024/12/22 14:59:59", 4.922, 133301, "2024/09/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("カリザ", 5, 0.0, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 6, 10023, 3, 2002, 2, -470.0, "2024/12/22 14:59:59", 9.638, 133301, "2024/09/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ミーア", 2, 0.0, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 6, 10024, 1, 2002, 1, -470.0, "2024/12/22 14:59:59", 2.88, 133401, "2024/09/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ミーア", 1, 0.0, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 6, 10025, 5, 2002, 2, -470.0, "2024/12/22 14:59:59", 4.818, 133401, "2024/09/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("グレイス", 1, 0.0, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 7, 10026, 2, 2002, 1, -470.0, "2025/03/22 14:59:59", 1.78, 133002, "2024/12/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("グレイス", 7, 0.0, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 7, 10027, 1, 2002, 2, -470.0, "2025/03/22 14:59:59", 6.15, 133002, "2024/12/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ヴァイオレット", 2, 0.0, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 7, 10028, 6, 2002, 1, -470.0, "2025/03/22 14:59:59", 4.28, 133102, "2024/12/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ヴァイオレット", 1, 0.0, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 7, 10029, 1, 2002, 2, -470.0, "2025/03/22 14:59:59", 0.0, 133102, "2024/12/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ルルィ", 1, 0.0, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 8, 10030, 2, 2002, 1, -470.0, "2025/06/23 14:59:59", 5.53, 136902, "2025/03/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("ルルィ", 7, 0.0, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 8, 10031, 9, 2002, 2, -470.0, "2025/06/23 14:59:59", 6.05, 136902, "2025/03/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("デュラン", 1, 0.0, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 8, 10032, 2, 2002, 1, -470.0, "2025/06/23 14:59:59", 0.0, 137001, "2025/03/15 15:00:00");
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES ("デュラン", 1, 0.0, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 8, 10033, 2, 2002, 2, -470.0, "2025/06/23 14:59:59", 0.0, 137001, "2025/03/15 15:00:00");
